/* 系统管理action */
import Fetchapi from '../util/fetch-api';
import { message } from 'antd';

// 查询所有菜单
export function findAllMenu() {
    return (dispatch) => {
      return Fetchapi.newPost(
        '/manager/menu/findAllMenu', {pageNum: 0, pageSize: 9999}
      ).then(
          msg => {
            dispatch({
              type: 'SYS::findAllMenu',
              payload: msg,
            });
            return msg;
          }
        ).catch(() => {
          message.error('网络错误，请重试');
        });
    };
}

// 查找所有的按钮权限的列表
export function submitLogin(params = {}) {
    return (dispatch) => {
        return Fetchapi.newPost(
            '/manager/admin/submitLogin', Object.assign({}, params, {
            })
        ).then(
            msg => {
                dispatch({
                    type: 'SYS::submitLogin',
                    payload: msg,
                });
                return msg;
            }
        ).catch(() => {
            message.error('网络错误，请重试');
        });
    };
}

// 条件查询产品类型(查询所有)
export function findProductTypeByWhere(params = {}) {
    return (dispatch) => {
        return Fetchapi.newPost(
            '/manager/productType/list', params
        ).then(
            msg => {
                dispatch({
                    type: 'SHOP::findProductTypeByWhere',
                    payload: msg,
                });
                return msg;
            }
        ).catch(() => {
            message.error('网络错误，请重试');
        });
    };
}

// 查询所有用户（内部用户）
export function findAll(params = {}) {
    return (dispatch) => {
        return Fetchapi.newPost(
            '/manager/user/findAll', params, 'post'
        ).then(
            msg => {
                dispatch({
                    type: 'SYS::findAll',
                    payload: msg,
                });
                return msg;
            }
        ).catch(() => {
            message.error('网络错误，请重试');
        });
    };
}

// 添加用户（内部用户）
export function addAdminUserInfo(params = {}) {
    return (dispatch) => {
        return Fetchapi.newPost(
            '/manager/user/addAdminUserInfo', params, 'post', true
        ).then(
            msg => {
